import "../App.css";
import airbnb from "../assets/airbnb-1.svg";
import bookingcom from "../assets/bookingcom-1.svg";
import { NavLink } from "react-router-dom";
import React from "react";
import Drawer from "@material-ui/core/Drawer";
import withStyles from "@material-ui/core/styles/withStyles";
import {
	List,
	ListItem,
	ListItemIcon,
	ListItemText,
	Divider,
} from "@material-ui/core";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";

export default function MobileNav() {
	const toggleDrawer = () => {
		// if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
		//   return;
		// }

		this.setState({ left: false });
	};

	const openDrawer = () => {
		this.setState({
			left: true,
		});
	};

	return (
		<div className="navListContMobile">
			<Drawer open={this.props.left} onClose={this.props.toggleDrawerHandler}>
				{"left"}
			</Drawer>
			<ul className="navList">
				<li className="navListItem">
					<NavLink className={"navLink"} to="/">
						Home
					</NavLink>
				</li>
				<li className="navListItem">
					<NavLink className={"navLink"} to="/gallerie">
						Gallerie
					</NavLink>
				</li>
				<li className="navListItem">
					<NavLink className={"navLink"} to="/">
						√úber uns
					</NavLink>
				</li>
				<li className="navListItem">
					<NavLink className={"navLink"} to="/">
						Kontakt
					</NavLink>
				</li>
				<li className="navListItem">
					<a href="http://www.booking.com/Share-BY2Hne">
						<img className="navIcon navIcons" src={airbnb}></img>
					</a>
					<a href="http://www.airbnb.com/">
						<img className="navIcon navIcons" src={bookingcom}></img>
					</a>
				</li>
			</ul>
		</div>
	);
}
